export class User {
  constructor(email, token, localId, expirationDate) {
    this.email = email;
    this.token = token;
    this.localId = localId;
    this.expirationDate = expirationDate;
  }

  get expireDate() {
    return this.expirationDate;
  }

  get userToken() {
    return this.token;
  }

}
